import {createBrowserRouter, RouterProvider} from "react-router-dom";
import './App.css';
import Employee from "./components/getEmployee/Employee";
import AddEmp from "./components/addEmployee/addEmp";
import UpdateEmp from "./components/updateEmployee/updateEmp";
import Signup from "./components/User/signup.js"
import Login from "./components/Auth/login.js"
import Dashboard from "./components/Main/dashboard.jsx";


function App() {
  const [username, setUsername] = useState("");
  const route = createBrowserRouter([

    {
      path:"/",
      element:<Employee />
    },
    {
      path:"/signup",
      element:<Signup />
    },
    {
      path:"/login",
      element:<Login setUsernameusername={setUsernameusername}/>
    },
    {
      path:"/dash",
      element:<Dashboard username={username} />
    },
    {
      path:"/add",
      element:<AddEmp />
    },
    {
      path:"/edit/:id",
      element:<UpdateEmp />
    }
  ])
  return (
    <div className="App">
      <RouterProvider router={route}></RouterProvider>
    </div>
  );
}

export default App;
